    container: {
      display: 'flex',
    },
    contentBox: {
      flex: 1,
      display: 'flex',
      flexDirection: 'column',
    },
    headerBox: {
      py: 2,
      px: 4,
      bgcolor: '#FCFCFC',
      color: '#344955',
      textAlign: 'center',
    },
    mainBox: {
      flex: 1,
      py: 6,
